import * as i from "react";
import n from "../lib/IconBase.es.js";
import r from "../defs/HighDefinition.es.js";
const o = i.forwardRef((e, t) => /* @__PURE__ */ i.createElement(n, { ref: t, ...e, weights: r }));
o.displayName = "HighDefinitionIcon";
const m = o;
export {
  m as HighDefinition,
  o as HighDefinitionIcon
};
